IF NOT EXISTS(SELECT * FROM master.sys.databases WHERE [name] = 'MADExpoKJ')
BEGIN
	CREATE DATABASE MADExpoKJ;
END

GO

USE MADExpoKJ;

IF EXISTS(SELECT * FROM sys.tables WHERE [name] = 'Session')
BEGIN
	DROP TABLE [Session];
END

IF EXISTS(SELECT * FROM sys.tables WHERE [name] = 'Speaker')
BEGIN
	DROP TABLE [Speaker];
END

CREATE TABLE [Speaker]
(
	SpeakerId INT NOT NULL PRIMARY KEY IDENTITY(1,1),
	FirstName NVARCHAR(100) NOT NULL,
	LastName NVARCHAR(100) NOT NULL,
	Twitter NVARCHAR(30) NULL,
	Bio NVARCHAR(MAX) NULL,
	Pic VARBINARY(MAX) NULL
)

CREATE TABLE [Session]
(
	SessionId INT NOT NULL PRIMARY KEY IDENTITY(1,1),
	SpeakerId INT NOT NULL REFERENCES [Speaker]([SpeakerId]),
	[Title] NVARCHAR(1000) NOT NULL,
	[Level] SMALLINT NOT NULL,
	[Abstract] NVARCHAR(MAX) NULL
)

